import Vue from 'vue';
import Router from 'vue-router';
import Home from '../views/Home.vue';  // Adjusted path
import SearchPlayer from '../views/SearchPlayer.vue';  // Adjusted path
import Teams from '../views/Teams.vue';  // Adjusted path
import About from '../views/About.vue';  // Adjusted path

Vue.use(Router);

export default new Router({
  mode: 'history',
  routes: [
    {
      path: '/',
      name: 'home',
      component: Home,
    },
    {
      path: '/search',
      name: 'search',
      component: SearchPlayer,
    },
    {
      path: '/teams',
      name: 'teams',
      component: Teams,
    },
    {
      path: '/about',
      name: 'about',
      component: About,
    },
  ],
});
